def render_template(html_file, datos):
	template = open(html_file, "r")
	tpl = SimpleTemplate(template)
	return tpl.render(datos)


class LivechatController(http.Controller):


	@http.route('/mail/norma/envio_informacion/<string:uuid>/<string:email>', type="http", auth="none")
	def mail_norma_envio_informacion(self, uuid, email, **kwargs):
		mail_channel = request.env["mail.channel"].sudo().search([('uuid', '=', uuid)], limit=1)
		res = mail_channel.action_envio_informacion(email = email)
		return res



	@http.route('/mail/norma/assets/<string:doc>', type="http", auth="none")
	def mail_norma_asset(self, doc, **kwargs):
		modules_path = request.env["ir.config_parameter"].sudo().search([("key","=", "custom.modules.path")], limit=1).value
		html_path= modules_path + '/opit_imco_norma/others/' + doc
		with open( html_path, 'r') as myfile:
			html = myfile.read().replace('\n', '')
		response = werkzeug.wrappers.Response()
		response.data = html
		response.mimetype = 'text/html'
		headers = werkzeug.wrappers.Headers()
		headers.set('Content-Disposition', 'inline', filename=doc.encode('latin-1'))
		response.headers = headers
		return response


