	@http.route('/mail/norma/informacion/<string:uuid>', type="http", auth="none")
	def mail_norma_documento_informacion(self, uuid, **kwargs):
		mail_channel = request.env["mail.channel"].sudo().search([('uuid', '=', uuid)], limit=1)
		recomendacion = mail_channel.obtiene_recomendacion_conversacion()
		modules_path = request.env["ir.config_parameter"].sudo().search([("key","=", "custom.modules.path")], limit=1).value
		file = modules_path + "opit_imco_norma/others/documento_informacion.html"
		web_path = request.env["ir.config_parameter"].sudo().search([("key","=", "web.base.url")], limit=1).value
		url_transcripcion = web_path + "/mail/norma/transcripcion/" + uuid
		parameters = {
			'titulo' : "RECOMENDACIONES DE NORMA",
			'estado' : "" if mail_channel.estado_id.id in [False, None] else mail_channel.estado_id.name,
			'municipio' : "" if mail_channel.municipio_id.id in [False, None] else mail_channel.municipio_id.name,
			'cp' : "" if mail_channel.cp_id.id in [False, None] else ( "(" + mail_channel.cp_id.cp + ") " + mail_channel.cp_id.name),
			'delito' : "" if mail_channel.delito_id.id in [False, None] else mail_channel.delito_id.name,
			'jurisdiccion' : "" if mail_channel.jurisdiccion_id.id in [False, None] else mail_channel.jurisdiccion_id.name,
			'variante' : "" if mail_channel.variante_id.id in [False, None] else mail_channel.variante_id.name,
			"recomendacion" : recomendacion,
			"url_recomendacion" : mail_channel.url_recomendacion,
			"url_transcripcion" : url_transcripcion,
			'mensajes' : [ {
				"remitente" : "Norma: La abogada de las víctimas",
				"mensaje" : "Hola, ¿cómo te puedo ayudar?"
				} ],
			'entidades' : {},
			}
		for m in mail_channel.message_ids.sorted(key=lambda r: r.id):
			parameters["mensajes"].append({
				'remitente' : m.author_id.name if m.author_id.id not in [False, None, ''] else "Tú",
				'mensaje' : m.body if ";;;" not in m.body else m.body.split(";;;")[-1],
				})
		#Inicializa en vacio todas las entidades asociadas al delito-jurisdiccion
		for en in mail_channel.delito_jurisdiccion_id.entidades_requeridas_ids:
			if en.entidad_id.codigo not in parameters["entidades"]:
				parameters["entidades"][en.entidad_id.codigo] = ""
		#Asigna las variables de las entidades reconocidas
		i = 0
		for en in mail_channel.messages_analisis_entidades_ids:
			if i == 0: 
				parameters["entidades"][en.entidad_id.codigo] += "," 
			parameters["entidades"][en.entidad_id.codigo] += en.valor
			i += 1
		if "municipio" not in parameters["entidades"]:
			parameters["entidades"]["municipio"] = ""
		pprint.pprint(parameters)
		#html = json.dumps(parameters)
		try:
			html = render_template(file, parameters)
			style_path= modules_path + '/opit_imco_norma/static/src/less/style_documento_informacion.css'
			header_path= modules_path + '/opit_imco_norma/others/documento_informacion_header.html'
			footer_path= modules_path + '/opit_imco_norma/others/documento_informacion_footer.html'
			html = html.replace("style.css", style_path)
			origen_path = (segment for segment in style_path.split('/') if segment)
			#img_path= "data:image/png;base64,"
			#html = html.replace("sevac.png", img_path)
			css_file = get_resource_path(*origen_path)
			options = {
				'page-size': 		'Letter',
				'orientation': 		'Portrait',
				'margin-top': 		'1.2in',
				'margin-right': 		'0in',
				'margin-bottom': 	'1.2in',
				'margin-left': 		'0in',
				'encoding': 		"UTF-8",
				'custom-header' : 	[('Accept-Encoding', 'gzip')],
				'no-outline': 		None,
				"--header-html" : 	header_path,
				"--header-spacing" : 	10,
				"--footer-html" : 	footer_path,
				"--footer-spacing" : 	1,
				#"header-line" : 	True,
				#'cookie': [('cookie-name1', 'cookie-value1'),('cookie-name2', 'cookie-value2'),],
				#"top" : '2cm',
				#'header-right': "Página [page] de [topage]",
				}
			pprint.pprint(options)
			pdf = pdfkit.from_string(html, False, css=css_file, options=options)
			response = werkzeug.wrappers.Response()
			response.data = pdf
			response.mimetype = 'application/pdf'
			headers = werkzeug.wrappers.Headers()
			headers.set('Content-Disposition', 'inline', filename=parameters["titulo"].encode('latin-1'))
			response.headers = headers
			return response
		except:
			traceback.print_exc(file=sys.stdout)
			return False

